definition:
The adverse event occurred during or immediately prior to a clinical procedure, but the problem was identified and corrected before harm could be caused.
E.g.1. an IVD gave a false reading but it was recognized as incorrect before treatment decisions were made and without any clinically significant delay to diagnosis;
E.g.2. a surgical device malfunctioned during pre-use checks and the malfunction was corrected or an alternative device was available without any clinically significant delay to the procedure.

The adverse event occurred while the device was being used in a non-clinical setting and/or procedure and could not have any impact on a patient
E.g.1. an IVD gave a false reading when testing an External Quality Assessment (EQA) sample;
E.g.2. a surgical device malfunctioned during cleaning and/or maintenance.
